import React from 'react';
import { Card, CardContent, Typography, List, ListItem, ListItemAvatar, Avatar, ListItemText } from '@mui/material';

const UserFollowers = ({ followers }) => (
  <Card>
    <CardContent>
      <Typography variant="h6">Followers</Typography>
      <List>
        {followers.map((follower, index) => (
          <ListItem key={index} button component="a" href={follower.html_url} target="_blank">
            <ListItemAvatar>
              <Avatar src={follower.avatar_url} alt={follower.login} />
            </ListItemAvatar>
            <ListItemText primary={follower.login} />
          </ListItem>
        ))}
      </List>
    </CardContent>
  </Card>
);

export default UserFollowers;
